  let username = Input1.text;
  let password = Input2.text;
  let ret = DoLogin.Login(username, password);
  if (ret.hasOwnProperty('access')) {
    appsmith.store.access_token = ret.acess;
    appsmith.store.refresh_token = ret.refresh;
    navigateTo("Tabela");
  } else {
    showAlert("Usuario ou senha incorretos");
  }
}

